package com.carrasco.openmapsapp

import android.content.Intent
import android.net.Uri
import androidx.appcompat.app.AppCompatActivity
import android.os.Bundle
import com.carrasco.openmapsapp.databinding.ActivityMainBinding

class MainActivity : AppCompatActivity() {
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        val binding = ActivityMainBinding.inflate(layoutInflater)
        setContentView(binding.root)

        binding.recycler.adapter = MapAdapter(
        listOf(
            Place("Madrid", "data:image/jpeg;base64,"),
            Place("Barcelona", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRveoZyQMgYAkkgZ_rkQxfGMR9ubrS-9aPI_w&usqp=CAU"),
            Place("Sevilla", "data:image/jpeg;base64,"),
            Place("Malaga", "data:image/jpeg;base64,"),
            Place("Cadiz", "data:image/jpeg;base64,"),
            Place("Cordoba", "data:image/jpeg;base64,"),
            Place("Almeria", "data:image/jpeg;base64,"),
            Place("Merida", "data:image/jpeg;base64,"),
        )
        ) {
            val gmmIntentUri = Uri.parse("geo:0,0?q=${it.name}")
            val mapIntent = Intent(Intent.ACTION_VIEW, gmmIntentUri)
            mapIntent.setPackage("com.google.android.apps.maps")
            startActivity(mapIntent)
        }
    }
}